import React, { Component }  from 'react';
import MUIDataTable from "mui-datatables";

const PatientsSlideShow = ({data}) => {
  const columns = ["Nombre", '2da col', '3era col'];

  let datos = ["Juan", "Pedro","Lucas"];


  const options = {
    filterType: 'checkbox',
    rowsPerPage: 3,
    rowsPerPageOptions: [5,10,15],
    textLabels:{
      body: '' //estp pa q cuando esten fetcheando los mensajes, aparezca en blanco el table
    }
  };  

  return(
    <MUIDataTable
      title={"Pacientes"}
      data={datos}
      columns={columns}
      options={options}
    />
  )
}

export default PatientsSlideShow;
